import React from "react";
function Profil(prop){
    return(
        <div className="card">
        <div className="card-item" style={{gridColumn:prop.info.column,gridRow:prop.info.rows,backgroundImage:`url(${prop.info.image})`}}>
            
            <button>click</button>
        </div>
        <div className="string">
            <span>{prop.info.thenam}</span>
            <span></span>
        </div>
        </div>
      
    );
}
export default Profil;
